import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import Nav from 'react-bootstrap/Nav';


class LpNav extends React.Component{
    render(){
        return(
           <Nav variant="tabs" defaultActiveKey="#first">
      <Nav.Item>
        <Nav.Link href="#" onClick={() => $(this).hideComponent("showHideLog")}>Log In</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="#" onClick={() => $(this).hideComponent("showHideSign")}>Sign Up</Nav.Link>
      </Nav.Item>
    </Nav>
        );
    }
}
export default LpNav;
